sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
    var builderrequest=inputs.builderRequest;
   var nominee= inputs.nominee.data;
 var addressArray=[];
   nominee.nomineeInfos.forEach(function(nomi){
    var pAddress=nomi.apnteDtls;
 var permanentAddress={
      addressdetails: {
        "state":pAddress.state,
        "pincode": pAddress.pincode,
        "street": pAddress.line2 +" "+ pAddress.line3,
        "country": pAddress.country,
        "landmark": pAddress.landmark,
        "city": pAddress.city
      },
      addresstype:"ADD_PMNT",
      sameastype:"ADD_PMNT"
    }
    addressArray.push(permanentAddress);
   });

   
    
    

})(inputs, outputs);

